import React from 'react';
import styled, {keyframes} from 'styled-components';

import themes from "../styles/themes"
import { connect } from "react-redux";
import {Div} from '../styles/DefaultStyles';


// 100% { -moz-transform: rotate(360deg); }
const keyframesSpin = keyframes`

  from {
    transform: rotate(0deg);
  }

  to {
    transform: rotate(360deg);
  }
`;


const DivContainer1 = styled(Div)`
	position: relative;

  animation: ${keyframesSpin} 4s linear infinite;
`;

const DivContainer2 = styled(Div)`
	position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);

  width: 100%;
  height: 100%;
`;


// size, w : h = 9 : 8
const IconLoading = ({width, height, themeName}) => {

	return (

	<DivContainer1 style= {{ width: `${width}`, height:`${height}` }} >
		<DivContainer2  >
		<svg 

			className="icon"
			xmlns="http://www.w3.org/2000/svg" 

			width="100%"
			height="100%"
			viewBox="0 0 512 512"

			fill={ themes[themeName]["color_normal"] }
			>


			<path 
				d="M304 48c0 26.51-21.49 48-48 48s-48-21.49-48-48 21.49-48 48-48 48 21.49 48 48zm-48 368c-26.51 0-48 21.49-48 48s21.49 48 48 48 48-21.49 48-48-21.49-48-48-48zm208-208c-26.51 0-48 21.49-48 48s21.49 48 48 48 48-21.49 48-48-21.49-48-48-48zM96 256c0-26.51-21.49-48-48-48S0 229.49 0 256s21.49 48 48 48 48-21.49 48-48zm12.922 99.078c-26.51 0-48 21.49-48 48s21.49 48 48 48 48-21.49 48-48c0-26.509-21.491-48-48-48zm294.156 0c-26.51 0-48 21.49-48 48s21.49 48 48 48 48-21.49 48-48c0-26.509-21.49-48-48-48zM108.922 60.922c-26.51 0-48 21.49-48 48s21.49 48 48 48 48-21.49 48-48-21.491-48-48-48z">
				</path>

		</svg>
		</DivContainer2 >
	</DivContainer1 >
	)
}


function mapStateToProps(state) { 
  return { 
    themeName: state.themeName
  }; 
} 

/*
function mapDispatchToProps(dispatch) { 
  return { 
    readPlanTeam: (idPlanTeam) => dispatch(readPlanTeam(idPlanTeam)) 
  }; 
}
*/

export default connect(mapStateToProps)(IconLoading);
